#include <iostream>
#include <vector>
#include <map>

using namespace std;

class Solution {
public:
    const int INF = 10000;
    const int MIN = 0;
    bool hasGroupsSizeX(vector<int>& deck) {
        int size = (int)deck.size();
        if (size < 2) return false;
        map<int, int> M;
        int min, max;
        min = INF;
        max = MIN;
        int count = 0;
        for (auto &card : deck) {
            if (M[card] == 0) ++count;
            M[card] += 1;
        }
        
        for (auto &item : M) {
            int temp = item.second;
            max = max < temp ? temp : max;
            min = temp < min ? temp : min;
        }
        
        if (min == 1) return false;
        if (max == min) return true;
        
        int min_devide = 2;
        while (min % min_devide) ++min_devide;
        
        for (auto &item : M) {
            if (item.second % min_devide != 0)
                return false;
        }
        return true;
    }
};

